import React,{ useState, useEffect, Fragment}  from 'react';
import { IoIosArrowForward, IoIosArrowDown} from 'react-icons/io';
import './ListProperties.css'
const ListProperties = ({image, name, created_by, description }) => {
const [arrow, setArrow ] = useState(false);
  return(
    <Fragment>
      <ul className = 'list-properies'>
        <li><span className = 'imageContainer'>{arrow ? <IoIosArrowForward className = 'arrow'/>:<IoIosArrowDown className = 'arrow'/>}<h3>Image</h3></span></li>
        <li><span className = 'authorContainer'><IoIosArrowForward className = 'arrow'/><h3>Title</h3></span></li>
        <li><span className = 'created_byContainer'><IoIosArrowForward className = 'arrow'/><h3>Author</h3></span></li>
        <li><span className = 'durationContainer'><IoIosArrowForward className = 'arrow'/><h3>Description</h3></span></li>
      </ul>
   </Fragment>
  )
}
export default ListProperties;
